import React from "react";

export default function Example(props) {
  if (props.examples) {
    return (
      <div className="Example">
        <strong> Example: </strong>
        {props.synonyms.map(function (examples, index) {
          return <div key={index}>{examples} </div>;
        })}
      </div>
    );
  } else {
    return null;
  }
}
